import{_ as a,a as r,b as o,c as t}from"./chunks/rtk_holybro_h-rtk-f9p_spec.BNqL4kUJ.js";import{_ as s}from"./chunks/rtk_holybro_h-rtk_mount_3.o-xCr925.js";import{_ as i,c as l,a8 as h,o as p}from"./chunks/framework.BDnHobkS.js";const P=JSON.parse('{"title":"Holybro H-RTK-F9P GNSS","description":"","frontmatter":{},"headers":[],"relativePath":"uk/gps_compass/rtk_gps_holybro_h-rtk-f9p.md","filePath":"uk/gps_compass/rtk_gps_holybro_h-rtk-f9p.md"}'),n={name:"uk/gps_compass/rtk_gps_holybro_h-rtk-f9p.md"};function c(m,e,d,f,b,u){return p(),l("div",null,e[0]||(e[0]=[h('<h1 id="holybro-h-rtk-f9p-gnss" tabindex="-1">Holybro H-RTK-F9P GNSS <a class="header-anchor" href="#holybro-h-rtk-f9p-gnss" aria-label="Permalink to &quot;Holybro H-RTK-F9P GNSS&quot;">​</a></h1><div class="tip custom-block"><p class="custom-block-title">TIP</p><p><a href="./../dronecan/holybro_h_rtk_zed_f9p_gps.html">Holybro H-RTK ZED-F9P Rover</a> is an upgraded version of this module.</p></div><p>The <a href="https://holybro.com/products/h-rtk-f9p-gnss-series" target="_blank" rel="noreferrer">Holybro H-RTK F9P GNSS</a> is an multi-band high-precision <a href="./../gps_compass/rtk_gps.html">RTK GNSS System</a> series launched by Holybro. This family is similar to the <a href="./../gps_compass/rtk_gps_holybro_h-rtk-m8p.html">H-RTK M8P</a> series, but uses multi-band RTK with faster convergence times and reliable performance, concurrent reception of GPS, GLONASS, Galileo and BeiDou, and faster update rate for highly dynamic and high volume applications with centimeter-accuracy. Він використовує модуль u-blox F9P, компас IST8310 та індикатор з триколірним світлодіодом. Також в ньому є інтегрований вимикач безпеки для простої та зручної роботи.</p><p>Є три моделі Holybro H-RTK F9P на вибір, кожна з різним дизайном антени, щоб задовольнити різні потреби. Refer to <a href="#specification-and-model-comparison">Specification and Model Comparison section</a> for more details.</p><p>Using RTK allows PX4 to get its position with centimetre-level accuracy, which is much more accurate than can be provided by a normal GPS.</p><p><img src="'+a+'" alt="h-rtk"></p><h2 id="де-купити" tabindex="-1">Де купити <a class="header-anchor" href="#де-купити" aria-label="Permalink to &quot;Де купити&quot;">​</a></h2><ul><li><a href="https://holybro.com/products/h-rtk-f9p-gnss-series" target="_blank" rel="noreferrer">H-RTK F9P (Holybro Website)</a></li><li><a href="https://holybro.com/collections/h-rtk-gps" target="_blank" rel="noreferrer">H-RTK Accessories (Holybro Website)</a></li></ul><h2 id="налаштування" tabindex="-1">Налаштування <a class="header-anchor" href="#налаштування" aria-label="Permalink to &quot;Налаштування&quot;">​</a></h2><p>RTK setup and use on PX4 via <em>QGroundControl</em> is largely plug and play (see <a href="./../gps_compass/rtk_gps.html">RTK GPS</a> for more information).</p><h2 id="підключення-та-з-єднання" tabindex="-1">Підключення та з&#39;єднання <a class="header-anchor" href="#підключення-та-з-єднання" aria-label="Permalink to &quot;Підключення та з&#39;єднання&quot;">​</a></h2><p>H-RTK Helical models come with both GH 10-pin &amp; 6-pin cables that are compatible with the GPS1 &amp; GPS2 ports on flight controllers that use the Pixhawk Connector Standard, such as <a href="./../flight_controller/pixhawk4.html">Pixhawk 4</a> and <a href="./../flight_controller/pixhawk5x.html">Pixhawk 5x</a>.</p><p>H-RTK Rover Lite доступний у двох версіях. The standard version comes with 10 pin connector for the <code>GPS1</code> port. The &quot;2nd GPS&quot; version comes with 6 pin connector for the <code>GPS2</code> port. This is used as a secondary GPS for <a href="./../gps_compass/#dual_gps">Dual GPS Systems</a>.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The cables/connectors may need to be modified in order to connect to other flight controller boards (see <a href="#pin-map">Pin Map</a> below).</p></div><h2 id="карта-виводів" tabindex="-1">Карта виводів <a class="header-anchor" href="#карта-виводів" aria-label="Permalink to &quot;Карта виводів&quot;">​</a></h2><p><img src="'+r+'" alt="h-rtk-f9proverpinmap"></p><p><img src="'+o+'" alt="h-rtk-f9phelicalpinmap"></p><h2 id="специфікація-та-порівняння-моделеи" tabindex="-1">Специфікація та порівняння моделей <a class="header-anchor" href="#специфікація-та-порівняння-моделеи" aria-label="Permalink to &quot;Специфікація та порівняння моделей&quot;">​</a></h2><p><img src="'+t+'" alt="h-rtk-f9pspec"></p><h2 id="аксесуари-до-gps" tabindex="-1">Аксесуари до GPS <a class="header-anchor" href="#аксесуари-до-gps" aria-label="Permalink to &quot;Аксесуари до GPS&quot;">​</a></h2><p><a href="https://holybro.com/products/vertical-mount-for-h-rtk-helical" target="_blank" rel="noreferrer">H-RTK Mount (Holybro Website)</a></p><p><img src="'+s+'" alt="h-rtk"></p>',22)]))}const y=i(n,[["render",c]]);export{P as __pageData,y as default};
